import React from 'react';
import BigCalendar from 'react-big-calendar'
import moment from 'moment'
BigCalendar.momentLocalizer(moment);


export default class Calendar extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <BigCalendar
        style={{height: '420px'}}
        events={[]}
      />
    );
  }
}
